import './photography.scss';
import photos from '../../assets/Photography';
import Masonry from 'react-masonry-css';


const breakpointColumnsObj = {
  default: 4,
  1100: 3,
  500: 2
};

var items = [
  {id: 1, name: 'My First Item'},
  {id: 2, name: 'Another item'},
  {id: 3, name: 'Third Item'},
  {id: 4, name: 'Here is the Fourth'},
  {id: 5, name: 'High Five'}
];

// Convert array to JSX items
items = items.map(function(item) {
  return <div key={item.id}>{item.name}</div>
});

function Photography() {

  return (

    <div className="Photography">
      <p>Photography</p>

      {/* {ShowPhotos()}

      <Masonry
        breakpointCols={breakpointColumnsObj}
        className="grid"
        columnClassName="grid-column">
        {

        }
      </Masonry> */}


      <Masonry
        breakpointCols={myBreakpointsAndCols}
        className="my-masonry-grid"
        columnClassName="my-masonry-grid_column"
      >
        {items}
      </Masonry>



    </div>
  )
}

function ShowPhotos() {
  return (
    <div className="Photos">
      <img className="photo" src={photos.Angus} alt="" />
      <img className="photo" src={photos.Ian} alt="" />
      <img className="photo" src={photos.Lagunitas} alt="" />
      <img className="photo" src={photos.Stargazing} alt="" />
      <img className="photo" src={photos.Gabby} alt="" />
      <img className="photo" src={photos.Bridge} alt="" />
      <img className="photo" src={photos.RedPurple} alt="" />
      <img className="photo" src={photos.JulianGeronimo} alt="" />
      <img className="photo" src={photos.FlowerBoy} alt="" />
      <img className="photo" src={photos.KyuFlare} alt="" />
      <img className="photo" src={photos.Foggy} alt="" />
      <img className="photo" src={photos.Paolina} alt="" />
      <img className="photo" src={photos.RedMotorcycles} alt="" />
      <img className="photo" src={photos.SamStars} alt="" />
      <img className="photo" src={photos.Seoul} alt="" />
      <img className="photo" src={photos.Silvertone} alt="" />
      <img className="photo" src={photos.Sunset} alt="" />
      <img className="photo" src={photos.Beach} alt="" />
    </div>
  )
}

export default Photography

